this.CBB=this.CBB||{},this.CBB.templates=this.CBB.templates||{},this.CBB.templates["0-browse"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return"\t<h1>browse</h1>"},useData:!0}),this.CBB.templates["0-help"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return'\t<h2 class="title is-2">Help</h2>\n<div>\n\tYou need help? With this dumb, free thing?! Fine, here:\n</div>\n\n\x3c!-- <ul>\n\n<li>\n\tIf ur fancy, use <a href="https://cwiki.apache.org/confluence/display/solr/The+Standard+Query+Parser">Lucene query syntax</a> (this thing runs at least in part on <a href="http://lucene.apache.org/solr/">Apache Solr</a>). If ur a tl;dr type, just know you can do Googley stuff, like <span class="copy-trigger" data-toggle="tooltip" data-string=\'dimello +wompler\'><span class="loc-string">"dimello +wompler"</span></span> or <span class="copy-trigger" data-toggle="tooltip" data-string=\'ducca -list\'><span class="loc-string">"ducca -list"</span></span> or whatev.\n</li>\n\n<li>Every query is run against the bits index first and <em>from that result set</em> we extract the locations (and also <em>from that result set</em> the facets are extracted). The implication is that if you wanted to search for, say, "Boston" to see if any references exist in or around that fine city, you\'ll only get results if the name or description of the bit has the word "Boston" in it. We didn\'t expect anybody would want to initiate spatial processing just to find out if we have bits mapped to Oklahoma or Chil or wherever (you can just run an empty query and check the map, after all). If you do want spatial query, though, tell Disqus about it <span class="glyphicon glyphicon-arrow-right"></span></li>\n\n<li>timestamps</li>\n\n</ul> --\x3e\n\n<div style="padding-top:5%;" class="tile content is-ancestor is-size-7">\n  <div class="tile is-vertical is-8">\n    <div class="tile">\n      <div class="tile is-parent is-vertical">\n        <article class="tile is-child box">\n        <h4 class="title is-4">Timestamps: <img class="" src="https://a-v2.sndcdn.com/assets/images/header/cloud@2x-e5fba46.png" style="height:20px;filter: drop-shadow(1px 1px 2px rgba(0,0,0,0.9));"> <small>v.</small> <img class="" src="http://v.fastcdn.co/t/fbd61fb6/9f77a6cf/1506364214-1020996-166x62-HOWLLogoHorizontalTeal.png" style="height:20px;filter:grayscale(1);"></h4>\n      <p>Each record has <strong>tstart</strong> and <strong>tend</strong> timestamps - ostensibly these frame the specific instance within the episode. However, when CBB audio files were moved behind the Howl paywall, it rendered many of the timestamps incorrect - as paywalled episodes pass the edit points where commercials used to be, they\'re offset by however long the excised commercials were.</p><p>Timestamps can still be used to get close to the instance when listening, but they are no longer accurate enough to be used for, say, supercutting or something.</p>\n        </article>\n\n      </div>\n      <div class="tile is-parent">\n        <article class="tile is-child box">\n          <h4 class="title is-4">The Map <i class="fa fa-map-o"></i></h4>\n          <p>There\'s a Leaflet instance under here that will display the geometries associated with any bits of type="location." Look for the <i class="fa fa-map-marker"></i> and click it to zoom the map to that location. More on that under "Locations."</p>\n          <p>But a note or two about how to use said map: in an effort to reduce clutter, there are no map controls as you might find in other web maps. A zoom bar, +/-, maybe a panning control, too. None of that here - just grab the map to move it and trackpad|scroll to zoom in and out. Optionally you can shift-click+hold-drag-release in order to "select" an area of the map to which you\'ll immediately pan/scroll.</p>\n        </article>\n      </div>\n    </div>\n    <div class="tile is-parent">\n      <article class="tile is-child box">\n        <h4 class="title is-4">Searching <i class="fa fa-search"></i></h4>\n      <p>Basically you can just type into the box like a monkey might do it - "huell" or "fourvel" and so forth. Strictly speaking you never even have to press the search button - <a href="https://www.elastic.co/products/elasticsearch">ElasticSearch</a> is fast enough to update pretty much with every character typed.</p>\n      <p>But also know that whatever you type into the box gets POSTed as-is, and since Search hits against an <a href="https://www.elastic.co/products/elasticsearch">ElasticSearch</a> (v5.6) index, (as with most search engines) there is <a href="https://www.elastic.co/guide/en/elasticsearch/reference/5.6/query-dsl-query-string-query.html">some pretty advanced stuff</a> you can do if you like. To wit:</p>\n\n\x3c!-- ******************************************** --\x3e\n\n  <article class="">\n    <h5 style="margin-top:2%; class="title is-5 is-paddingless"><strong>Fields:</strong></h5>\n      <dl class="content"">\n          <dt>find a specific bit using its full or partial value:</dt>\n          <dd><a href="#" class="cbb-trigger" data-target="bit:location" data-type="">bit:location</a> or <a href="#" class="cbb-trigger" data-target="bit:topping" data-type="">bit:topping</a> <code>// for DSALW\'s Queen\'s english ("topping hat")</code></dd>\n\n<dt>find bits by date (added/updated):</dt>\n          <dd><a href="#" class="cbb-trigger" data-target="updated_at:[2017-01-01T00:00:00Z TO 2017-01-31T23:59:59Z]" data-type="">updated_at:[2017-01-01T00:00:00Z TO 2017-01-31T23:59:59Z]</a></dd>\n<dd><small>Hint: updated_at is typically the same as created_at except when a record has been...updated. The implication is that you\'ll probably always want to use updated_at for any kind of date query.</small></dd>\n      </dl>\n\n  </article>\n\n\n\x3c!-- ******************************************** --\x3e\n\n  <article class="">\n    <h5 style="margin-top:2%; class="title is-5 is-paddingless"><strong>Boolean stuff:</strong></h5>\n      <div class="content"">\n        <dl>\n          <dt>combine terms with either word or character operators:</dt>\n<dd><a href="#" class="cbb-trigger" data-type="" data-target="bit:location +dimello">bit:location +dimello</a></dd>\n<dd><a href="#" class="cbb-trigger" data-type="" data-target="mexico -adomian">mexico -adomian</a></dd>\n<dd><a href="#" class="cbb-trigger" data-type="" data-target=\'collins -bit:"Phil Collins"\'>collins -bit:"Phil Collins"</a><code>//Phil Collins references beyond his Live Aid Concorde stunt</code></dd>\n<dd><a href="#" class="cbb-trigger" data-type="" data-target="where AND from AND dabney">where AND from AND dabney</a></dd>\n<dd><a href="#" class="cbb-trigger" data-type="" data-target="(wipe AND out) NOT hardcastle">(wipe AND out) NOT hardcastle</a></dd>\n<dd><small>Hint: otherwise-unqualified terms typed into the box are ANDed together by default.</small></dd>\n        </dl>\n      </div>\n  </article>\n\n    </div>\n  </div>\n  <div class="tile is-parent">\n    <article class="tile is-child box">\n\n           <h4 class="title is-4">Locations <i class="fa fa-map-marker"></i></h4>\n      <p>One of the bits is special (and in fact the original impetus of this entire effort). For <a href=\'#\' class=\'cbb-trigger\' data-type=\'bit\' data-target=\'Location\'>bits="Location"</a> the results will appear in the picklist (indicated by a map pin icon) <em>and</em> on the map under what you\'re reading now (hidden behind the main content area by default).</p><p>The ctrl key will toggle the map\'s visibility (as will the <i class="fa fa-map-o"></i> button); the <i style="font-size:1.3em;" class="fa fa-map-marker"></i> in the search results will zoom to that instance\'s referenced location. <a href="#" class=\'cbb-trigger\' data-type="" data-target=\'bit:Location +tags:"huell howser"\'>Huell Howser</a>, <a href="#" class=\'cbb-trigger\' data-type="" data-target=\'bit:Location +tags:"gino lambardo"\'>Gino Lambardo</a>, <a href="#" class=\'cbb-trigger\' data-type="" data-target=\'bit:Location +tags:"merrill shindler"\'>Merrill Shindler</a>, and <a href="#" class=\'cbb-trigger\' data-type="" data-target=\'bit:Location +tags:"shelly driftwood"\'>Shelly Driftwood</a> are all good for at least a few.</p>\n\n      <p>Another thing to note about locations is that unless there\'s a clamor for it we do NOT spatially-index the geometries for retrieval. So while of course you can query for <em>bits</em> that reference locations (and those referenced geometries will appear on the map with minimal interaction), we\'re not bothering to offer the ability to, say, zoom/pan the map and query for locations <em>in that area</em>. Like, who cares?</p><p>If somebody really wants that (or the tangential ability to query for bits that reference, say, the Boston area or Marina del Rey, maybe <a class="twitter-share-button" href="https://twitter.com/share" data-size="large" data-text="custom share text" data-url="https://dev.twitter.com/web/tweet-button" data-hashtags="comedybangbang,zapstraighttoit" data-via="twitterdev"><i class="fa fa-twitter"></i> say something</a>. But really if you\'re <em>that interested</em> you could just query for everything (<a href="#" class="cbb-trigger" data-type="" data-target="bit:location">"bit:Location"</a>) and zoom to the spot about which you\'re curious.</p>\n\n    </article>\n  </div>\n</div>'},useData:!0}),this.CBB.templates["0-home"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return'<section class="section">\n  <div class="container">\n    <div class="columns">\n\n<div class="column is-one-quarter"></div>\n\n    <div class="column">\n\n<div class="cbb-hero-instance">"Do you have a series of mole-like cavernous passages that go throughout the city -- almost like...remember that TV show \'Angel,\' uh, he coudn\'t go out in the sun, right? So but then they had to write storylines where it was during the day so they concocted a series of sewer caverns that he would travel the city from - do you have something like that?"</div>\n<div class="cbb-hero-credit">-- S. Aukerman (<a href="#" class="cbb-trigger" data-type="bit" data-target="Scott\'s Questions">Scott\'s Questions</a>), ep.<a href="#" class="cbb-trigger" data-type="episode" data-target="533">533</a></div>\n<div class="cbb-hero-credit">-- -- <a href="http://www.earwolf.com/show/comedy-bang-bang">Comedy Bang! Bang!</a></div>\n\n    </div>\n    \x3c!-- hero stuff --\x3e\n\n<div class="column is-one-quarter"></div>\n    </div>\n  </section>\n    <section class="section">\n      <div class="container">\n<div class="columns">\n  <div class="column" style="text-align:center;">\n    <h4 style="" class="cbb-title-sub title is-5"></h4>\n  </div>\n</div>\n\n  </div>\n</div>\n</section>\n'},useData:!0}),this.CBB.templates["0-huh"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return'  <div class="container">\n    <div class="columns">\n\n      <div class="column">\n\t<h1 class="title" style="text-align:center;">What\'s this, now?!\n\t<span class="bang-inline" style="font-size:1.2em;">\n<span class="icom-bang" style=""></span>\n  </span>\n\t</h1>\n    <p style="padding-bottom:40px;">Come on, guys -- it\'s a searchable index of all the recurring bits from the <em><a href="http://www.earwolf.com/show/comedy-bang-bang/">Comedy Bang! Bang!</a></em> podcast.\n    </p>\n</div>\x3c!-- .column --\x3e\n\n      <div class="column"></div>\n  <div class="column">\n\n  <h1 class="title" style="text-align:center;">\n    <span class="bang-inline" style="">\n  <span class="icom-bang" style=""></span>\n    </span>\n  Why?\n  </h1>\n  <p>Because <em><a href="http://www.earwolf.com/show/comedy-bang-bang/">CBB</a></em> is the best thing ever recorded. Or maybe the best thing to ever even happen at all.</p>\n\n</div>\x3c!-- .column --\x3e\n\n      <div class="column"></div>\n<div class="column">\n<h1 class="title" style="text-align:center;">Official thing?\n  <span class="bang-inline" style="">\n  <span class="icom-bang" style=""></span>\n  </span>\n</h1>\n<p style="text-align:center;">Isn\'t. Fansite.</p>\n</div>\x3c!-- .column --\x3e\n\n</div>\x3c!-- .columns --\x3e\n\n</div>\x3c!-- .container --\x3e\n'},useData:!0}),this.CBB.templates["0-search"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return"\t<h1>search</h1>\n"},useData:!0}),this.CBB.templates["0-support"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return"\t<h1>support</h1>"},useData:!0}),this.CBB.templates["0-update"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return"<h1>update</h1>"},useData:!0}),this.CBB.templates["0-updates"]=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){return"\t<h1>updates</h1>"},useData:!0}),this.CBB.templates.HowlEpisodeViewTpl=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){var r,l=a.helperMissing,n=t.escapeExpression;return'<a target="blank" href="'+n("function"==typeof(r=null!=(r=a.episode||(null!=e?e.episode:e))?r:l)?r.call(e,{name:"episode",hash:{},data:o}):r)+'" title="we can\'t yet link to Howl episode timestamps - this will go to the episode page">\n<img class="" src="images/ico.howl.png" height="30" width="20"> '+n("function"==typeof(r=null!=(r=a.episode_title||(null!=e?e.episode_title:e))?r:l)?r.call(e,{name:"episode_title",hash:{},data:o}):r)+" is at Howl.fm\n</a>"},useData:!0}),this.CBB.templates.activityViewTpl=Handlebars.template({compiler:[7,">= 4.0.0"],main:function(t,e,a,i,o){var r,l;return'<div class="activity-message">'+(null!=(r="function"==typeof(l=null!=(l=a.message||(null!=e?e.message:e))?l:a.helperMissing)?l.call(e,{name:"message",hash:{},data:o}):l)?r:"")+'<span class="activity-cancel fa fa-times-circle-o" style="margin-left:10px;"></span><span class="activity-throb fa fa-circle-o-notch fa-spin fa-3x fa-fw" style="margin-left:10px;"></span></div>'},useData:!0}),this.CBB.templates.baseLayerMnu=Handlebar